import React from "react";
import { incrementBid } from "../../store/ducks/cards/actions";
import "./Button.css";

const Button = ({ id }) => {
  return (
    <button
      type="button"
      className="container"
      onClick={() => incrementBid(id)}
    >
      fazer oferta
    </button>
  );
};

export default Button;
